            /// <param name="order">The order of the Gauss-Legendre Quadrature.</param>
            /// <param name="weights">The weights of the Gauss-Legendre Quadrature (output).</param>
            /// <returns>The abscissas, i.e. evaluation points of the Gauss-Legendre Quadrature</returns>
            public static double[] GetValue(int order, out double[] weights)
            {
                if (order < 1)
                {
                    throw new ArgumentException(String.Format(ExceptionMessages.ArgumentOutOfRangeGreaterEqual, "order", 2), nameof(order));
                }
                if (order > sm_WeightsZeroAlpha.Length)  // we cache the first 250 weights and abscissas only
                {
                    var abscissas = new double[order];
                    weights = new double[order];
                    ComputeCoefficients(order, abscissas, weights);

                    return abscissas;
                }
                weights = sm_WeightsZeroAlpha[order - 1];
                return sm_AbscissasZeroAlpha[order - 1];
            }

            /// <summary>Gets the weights and abscissas of a specific Gauss-Laguerre Quadrature.
            /// </summary>
            /// <param name="alpha">The parameter \alpha of the Gauss-Laguerre Quadrature.</param>
            /// <param name="order">The order of the Gauss-Legendre Quadrature.</param>
            /// <param name="weights">The weights of the Gauss-Legendre Quadrature (output).</param>
            /// <returns>The abscissas, i.e. evaluation points of the Gauss-Legendre Quadrature</returns>
            public static double[] GetValue(double alpha, int order, out double[] weights)
            {
                if (order < 1)
                {
                    throw new ArgumentException(String.Format(ExceptionMessages.ArgumentOutOfRangeGreaterEqual, "order", 2), nameof(order));
                }
                var abscissas = new double[order];
                weights = new double[order];
                ComputeCoefficients(alpha, order, abscissas, weights);

                return abscissas;
            }

#if DEBUG
            /// <summary>Writes weights and abscissas of the Gauss-Laguerre Quadrature for \alpha = 0.0 up to a specific order into a specific file.
            /// </summary>
            /// <param name="maxOrder">The maximal order.</param>
            /// <param name="filePath">The file path.</param>
            public static void Write(int maxOrder, string filePath)
            {
                var weightsStringBuilder = new StringBuilder();
                var abscissaStringBuilder = new StringBuilder();

                weightsStringBuilder.AppendLine("private static double[][] sm_Weights = {");
                abscissaStringBuilder.AppendLine("private static double[][] sm_Abscissas = {");


                for (int order = 1; order < maxOrder - 1; order++)
                {
                    var weights = new double[order];
                    var abscissas = new double[order];

                    ComputeCoefficients(order, abscissas, weights);

                    weightsStringBuilder.Append("\t new[] {");
                    abscissaStringBuilder.Append("\t new[] {");

                    weightsStringBuilder.AppendFormat(" {0},", weights[0].ToString("F17", CultureInfo.InvariantCulture));
                    weightsStringBuilder.AppendLine();
                    abscissaStringBuilder.AppendFormat(" {0},", abscissas[0].ToString("F17", CultureInfo.InvariantCulture));
                    abscissaStringBuilder.AppendLine();

                    for (int k = 1; k < order; k++)
                    {
                        weightsStringBuilder.AppendFormat("\t         {0},", weights[k].ToString("F17", CultureInfo.InvariantCulture));
                        weightsStringBuilder.AppendLine();
                        abscissaStringBuilder.AppendFormat("\t         {0},", abscissas[k].ToString("F17", CultureInfo.InvariantCulture));
                        abscissaStringBuilder.AppendLine();
                    }
                    weightsStringBuilder.AppendLine("\t       },");
                    abscissaStringBuilder.AppendLine("\t       },");
                }
                weightsStringBuilder.AppendLine("\t\t};");
                abscissaStringBuilder.AppendLine("\t\t};");

                var stream = File.CreateText(filePath);
                stream.WriteLine(weightsStringBuilder.ToString());
                stream.WriteLine(abscissaStringBuilder.ToString());

                stream.Close();
            }
#endif
            #endregion

            #region private (static) methods

            /// <summary>Computes the weights and evaluation points (=abscissas) with respect to the Gauss-Laguerre Quadrature.
            /// </summary>
            /// <param name="alpha">The parameter \alpha in the Gauss-Laguerre quadrature.</param>
            /// <param name="n">The order of the Gauss-Laguerre Quadrature, i.e. the number of points.</param>
            /// <param name="abscissas">The <paramref name="n"/> abscissas of the Gauss-Laguerre Quadrature (output).</param>
            /// <param name="weights">The <paramref name="n"/> weights of the Gauss-Laguerre Quadrature (output).</param>
            /// <param name="maxNumberOfRootIterations">The maximal number of iterations used for the Newton Approach.</param>
            /// <param name="tolerance">The (positive) tolerance used as exit condition for the Newton approach.</param>
            /// <exception cref="ArithmeticException">Thrown if a problem occurs while computing the roots of the Laguerre polynomials.</exception>
            private static void ComputeCoefficients(double alpha, int n, double[] abscissas, double[] weights, int maxNumberOfRootIterations = 5000, double tolerance = MachineConsts.TinyEpsilon)
            {
                /* compute the zeros of the n-th Laguerre-Polynomial, which is given via the recursive relation
                 * 
                 *  (j+1) * P_{j+1}(x)^\alpha = (-x +2j +1 + \alpha) * P_j(x)^\alpha - (j+\alpha) * P_{j-1}(x)^\alpha,
                 * 
                 *  p_0 = 1; p_1 = 0.
                 * 
                 * The derivative of P_n is given by [see formula (9.5.8c), 'Taschenbuch der Mathematik',
                 * Bronstein, 2. Edition, 1995]:
                 * 
                 *  This makes it easy to apply the Newton-Method with a good initial value.
                 */
                double gammaLnAlphaPlusN = SpecialFunction.Gamma.GetLogValue(alpha + n);
                double gammaLnN = SpecialFunction.Gamma.GetLogValue(n);

                /* initial point of the Newton-Method: (starting with the smallest root) */
                double x = (1.0 + alpha) * (3.0 + 0.92 * alpha) / (1.0 + 2.4 * n + 1.8 * alpha);

                for (int i = 0; i < n; i++)
                {
                    if (i == 1)
                    {
                        x += (15.0 + 6.25 * alpha) / (1.0 + 0.9 * alpha + 2.5 * n);
                    }
                    else if (i > 1)
                    {
                        int j = i - 1;
                        x += ((1.0 + 2.55 * j) / (1.9 * j) + 1.26 * j * alpha / (1.0 + 3.5 * j)) * (x - abscissas[i - 2]) / (1.0 + 0.3 * alpha);
                    }

                    bool foundRoot = false;  /* start Newton's method: */
                    int k = 1;

                    while ((k <= maxNumberOfRootIterations) && (foundRoot == false))
                    {
                        /* computes p_n(x): */
                        double pPreviousValue = 0.0;    // = p_0
                        double pValue = 1.0;   // = p_1

                        for (int j = 0; j <= n - 1; j++)
                        {
                            double pTempValue = pPreviousValue;
                            pPreviousValue = pValue;

                            pValue = ((2 * j + 1 + alpha - x) * pPreviousValue - (j + alpha) * pTempValue) / (j + 1);
                        }
                        double derivative = (n * pValue - (n + alpha) * pPreviousValue) / x;
                        double xTemp = x;

                        /* use Newton's method: */
                        x = x - pValue / derivative;
                        if (Math.Abs(x - xTemp) < tolerance)
                        {
                            foundRoot = true;

                            abscissas[i] = x;
                            weights[i] = -Math.Exp(gammaLnAlphaPlusN - gammaLnN) / (pPreviousValue * n * derivative);
                        }
                        k++;
                    }
                    if (k >= maxNumberOfRootIterations)
                    {
                        throw new ArithmeticException(String.Format("Could not compute the root of a specific Laguerre polynomial of degree {0}; null-based index of the root: {1}.", n, i));
                    }
                }
            }

            /// <summary>Computes the weights and evaluation points (=abscissas) with respect to the Gauss-Laguerre Quadrature and \alpha = 0.0.
            /// </summary>
            /// <param name="n">The order of the Gauss-Laguerre Quadrature, i.e. the number of points.</param>
            /// <param name="abscissas">The <paramref name="n"/> abscissas of the Gauss-Laguerre Quadrature (output).</param>
            /// <param name="weights">The <paramref name="n"/> weights of the Gauss-Laguerre Quadrature (output).</param>
            /// <param name="maxNumberOfRootIterations">The maximal number of iterations used for the Newton Approach.</param>
            /// <param name="tolerance">The (positive) tolerance used as exit condition for the Newton approach.</param>
            /// <exception cref="ArithmeticException">Thrown if a problem occurs while computing the roots of the Laguerre polynomials.</exception>
            private static void ComputeCoefficients(int n, double[] abscissas, double[] weights, int maxNumberOfRootIterations = 5000, double tolerance = MachineConsts.TinyEpsilon)
            {
                /* compute the zeros of the n-th Laguerre-Polynomial, which is given via the recursive relation
                 * 
                 *  (j+1) * P_{j+1}(x)^\alpha = (-x +2j +1 + \alpha) * P_j(x)^\alpha - (j+\alpha) * P_{j-1}(x)^\alpha,
                 * 
                 *  p_0 = 1; p_1 = 0.
                 * 
                 * The derivative of P_n is given by [see formula (9.5.8c), 'Taschenbuch der Mathematik',
                 * Bronstein, 2. Edition, 1995]:
                 * 
                 *  This makes it easy to apply the Newton-Method with a good initial value.
                 */

                /* initial point of the Newton-Method: (starting with the smallest root) */
                double x = 1.0 * 3.0 / (1.0 + 2.4 * n);

                for (int i = 0; i < n; i++)
                {
                    if (i == 1)
                    {
                        x += 15.0 / (1.0 + 2.5 * n);
                    }
                    else if (i > 1)
                    {
                        int j = i - 1;
                        x += ((1.0 + 2.55 * j) / (1.9 * j)) * (x - abscissas[i - 2]) / 1.0;
                    }

                    bool foundRoot = false;  /* start Newton's method: */
                    int k = 1;

                    while ((k <= maxNumberOfRootIterations) && (foundRoot == false))
                    {
                        /* computes p_n(x): */
                        double pPreviousValue = 0.0;    // = p_0
                        double pValue = 1.0;   // = p_1

                        for (int j = 0; j <= n - 1; j++)
                        {
                            double pTempValue = pPreviousValue;
                            pPreviousValue = pValue;

                            pValue = ((2 * j + 1 - x) * pPreviousValue - j * pTempValue) / (j + 1);
                        }
                        double derivative = (n * pValue - n * pPreviousValue) / x;
                        double xTemp = x;

                        /* use Newton's method: */
                        x = x - pValue / derivative;
                        if (Math.Abs(x - xTemp) < tolerance)
                        {
                            foundRoot = true;

                            abscissas[i] = x;
                            weights[i] = -1.0 / (pPreviousValue * n * derivative);
                        }
                        k++;
                    }
                    if (k >= maxNumberOfRootIterations)
                    {
                        throw new ArithmeticException(String.Format("Could not compute the root of a specific Laguerre polynomial of degree {0}; null-based index of the root: {1}.", n, i));
                    }
                }
            }
            #endregion
        }
